import React, { Component } from "react";
import ButtonGroup from "react-bootstrap/ButtonGroup";
import Button from "react-bootstrap/Button";
import './icons.css';

class DirectionsPicker extends Component {
  render() {
    return (

    <div>
        <h4></h4>
      <ButtonGroup aria-label="Basic example">
        <Button variant="secondary"><i class="material-icons">directions_bus</i></Button>
        <Button variant="secondary"><i class="material-icons">directions_bike</i></Button>
        <Button variant="secondary"><i class="material-icons">directions_car</i></Button>
        <Button variant="secondary"><i class="material-icons">directions_walk</i></Button>
      </ButtonGroup>

      </div>
    );
  }
}

export default DirectionsPicker;
